import Vue from 'vue';            
import Router from 'vue-router';


Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {   

      path: '/event',             
      name:'Event', 
      component:  Event,   
    },
    {   

      path: '/',             
      name: 'App',  
      component:  App,     
    }
    ,  
  ]
});
